import Accueil from './pages/Accueil';
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Link,
  Redirect
} from 'react-router-dom';

class App extends React.Component {
  render() {
    return (
      <Router>
        <Route path="/" component={Accueil} />
      </Router>

    );
  }
}

export default App;
